import React from 'react';
import git from '../assets/git.png';


function Work() {
	return (
		<div className="work-wrapper">
			<div className="work-header">
				<h1>My work</h1>
			</div>
			<div className="work-cards">
				<div className="card">
					<img title="Git"
			            src={git}
			            alt="Icon"
					/>
				</div>
				<div className="card">
					<img title="C++"
			            src={git}
			            alt="con"
					/>
				</div>
				
			</div>
		</div>
	);
}

export default Work;
